import { Link, NavLink, BrowserRouter as Router, } from "react-router-dom";
import "../../../styles/styles.scss"

const HomeRestaurant = (props) => {

  return (
    <div>
      <h3 className="promotion-title">In a rush?</h3>
      <div className="promotion-subtitle">Here’s the fastest delivery for you</div>
      <div className="horizontal-list">
        <Restaurant />
        <Restaurant />
        <Restaurant />
        <Restaurant />
      </div>
    </div>
  );
}

const Restaurant = (props) => {

  return (
    <Link
      to="/restaurant/4"
      className="nav-link restaurant-contain card">
      <img
        className="restaurant-img"
        src="https://cdn.concreteplayground.com/content/uploads/2020/04/Family-Feast-KFC-supplied.jpg" />
      <div className="restaurant-content">
        <h3 className="restaurant-name">McDonald's® (Adams  Wells)</h3>
        <p className="restaurant-description">Fast food - Milk tea</p>
        <p className="restaurant-description">0.9 Milies away - Free Delivery</p>
      </div>
    </Link>
  );
}


export default HomeRestaurant
